import React, {useState} from 'react';
import axios from 'axios';
import logo from './logo.svg';
import './App.css';



function App() {

  const musicLibrary = () => {axios.get('http://www.devcodecampmusiclibrary.com/api/music')
    .then(response => {
      console.log(response.data);
      musicLibrary = response.data

    })
    .catch(error => {
      console.log(error);
    });
  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
        <h1 class="display-1">Music Library Search</h1>
        <h1>{musicLibrary[0]}</h1>
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
